	xor  a                                                          ; $7ba2
	ldh  [rVBK], a                                                  ; $7ba3

; BC in 1st word, HL in 2nd word, each are addresses containing tile idxes
	ld   hl, wPhotoGetPointerToAddrWithLeftDigitTileIdxes           ; $7ba5
	ld   a, [hl+]                                                   ; $7ba8
	ld   c, a                                                       ; $7ba9
	ld   a, [hl+]                                                   ; $7baa
	ld   b, a                                                       ; $7bab
	ld   a, [hl+]                                                   ; $7bac
	ld   h, [hl]                                                    ; $7bad
	ld   l, a                                                       ; $7bae

; Store 2 tiles each of BC and HL in top row in tile map
	ld   de, _SCRN0+$ca                                             ; $7baf
	ld   a, [bc]                                                    ; $7bb2
	ld   [de], a                                                    ; $7bb3
	inc  bc                                                         ; $7bb4
	inc  e                                                          ; $7bb5
	ld   a, [bc]                                                    ; $7bb6
	ld   [de], a                                                    ; $7bb7
	inc  bc                                                         ; $7bb8
	inc  e                                                          ; $7bb9
	ld   a, [hl+]                                                   ; $7bba
	ld   [de], a                                                    ; $7bbb
	inc  e                                                          ; $7bbc
	ld   a, [hl+]                                                   ; $7bbd
	ld   [de], a                                                    ; $7bbe

; Repeat for 2nd row
	ld   de, _SCRN0+$ea                                             ; $7bbf
	ld   a, [bc]                                                    ; $7bc2
	ld   [de], a                                                    ; $7bc3
	inc  bc                                                         ; $7bc4
	inc  e                                                          ; $7bc5
	ld   a, [bc]                                                    ; $7bc6
	ld   [de], a                                                    ; $7bc7
	inc  bc                                                         ; $7bc8
	inc  e                                                          ; $7bc9
	ld   a, [hl+]                                                   ; $7bca
	ld   [de], a                                                    ; $7bcb
	inc  e                                                          ; $7bcc
	ld   a, [hl+]                                                   ; $7bcd
	ld   [de], a                                                    ; $7bce

; Repeat for 3rd row
	ld   de, _SCRN0+$10a                                            ; $7bcf
	ld   a, [bc]                                                    ; $7bd2
	ld   [de], a                                                    ; $7bd3
	inc  bc                                                         ; $7bd4
