	add  a                                                          ; $7f36
	add  a                                                          ; $7f37
	ld   c, a                                                       ; $7f38
	ld   b, $00                                                     ; $7f39
	ld   hl, TrainLine1stHalfOfScrollTextTiles                      ; $7f3b
	add  hl, bc                                                     ; $7f3e

; 1st word contains source
	ld   a, [hl+]                                                   ; $7f3f
	ldh  [rHDMA2], a                                                ; $7f40
	ld   a, [hl+]                                                   ; $7f42
	ldh  [rHDMA1], a                                                ; $7f43

	ld   a, HIGH(_VRAM+$800)                                        ; $7f45
	ldh  [rHDMA3], a                                                ; $7f47
	ld   a, LOW(_VRAM+$800)                                         ; $7f49
	ldh  [rHDMA4], a                                                ; $7f4b

; 3rd byte is hdma5
	ld   a, [hl+]                                                   ; $7f4d
	cp   $46                                                        ; $7f4e
	jr   c, :+                                                      ; $7f50
	ld   a, $46                                                     ; $7f52
:	ldh  [rHDMA5], a                                                ; $7f54
	ret                                                             ; $7f56


