	add  a                                                          ; $7f5d
	add  a                                                          ; $7f5e
	ld   c, a                                                       ; $7f5f
	ld   b, $00                                                     ; $7f60
	ld   hl, TrainLine2ndHalfOfScrollTextTiles                      ; $7f62
	add  hl, bc                                                     ; $7f65

; 1st word contains source
