VBlankQueueFunc_UpdateCreditsSpriteTileData::
; Transfer to tile data bank 0
	xor  a                                                          ; $78c0
	ldh  [rVBK], a                                                  ; $78c1
	pop  hl                                                         ; $78c3

; Source in stack
	ld   a, h                                                       ; $78c4
	ldh  [rHDMA1], a                                                ; $78c5
	ld   a, l                                                       ; $78c7
	ldh  [rHDMA2], a                                                ; $78c8

; Transfer 1st $280 tiles
	ld   a, HIGH(_VRAM)                                             ; $78ca
	ldh  [rHDMA3], a                                                ; $78cc
	ld   a, LOW(_VRAM)                                              ; $78ce
	ldh  [rHDMA4], a                                                ; $78d0
	ld   a, ($280/$10)-1                                            ; $78d2
	ldh  [rHDMA5], a                                                ; $78d4

; Then 2nd
	ld   a, HIGH(_VRAM+$400)                                        ; $78d6
	ldh  [rHDMA3], a                                                ; $78d8
	ld   a, LOW(_VRAM+$400)                                         ; $78da
	ldh  [rHDMA4], a                                                ; $78dc
	ld   a, ($280/$10)-1                                            ; $78de
	ldh  [rHDMA5], a                                                ; $78e0
	ret                                                             ; $78e2


